function Nav()
{
    return(
   <>
    <div>
    <pre>
        <ul>
        <li><a class="active" href="about.html">HOME</a></li> <li><a  href="artifical in.html">NEWS</a></li>  
        
        <li><a  href="computer.html">ABOUT     </a></li>
        <li><a  href="opacity.html">CONTACT</a></li>
    </ul>
    </pre>
        
    </div>
   </> 
    )
            
}
       
    export default Nav;
